        case on
        mcopy global.macros
        keep global


splash start
        using globalData
        using screenData
        using splashData
        using controlsData
        using gameData

        
drawSplashBase entry

        lda #0
        sta rowCounter
        sta screenCounter
        sta dataCounter

rowLoop anop

        lda rowCounter
        asl a
        tax
        lda screenRowOffsets,x
        sta rowAddress
        tax

        lda #0
        sta colCounter

colLoop anop

        short m
        ldx dataCounter
        lda >splashDataList,x
        ldx screenCounter
        sta >SCREEN_ADDR,x
        long m

        inc dataCounter
        inc dataCounter
        inc screenCounter

        inc colCounter
        lda colCounter
        cmp #$A0
        bcs rowDone
        bra colLoop

rowDone anop

        inc rowCounter
        lda rowCounter
        cmp #$C8
        bcs allDone
        bra rowLoop

allDone anop

        lda #100
        sta spriteSrcX

        lda #41
        sta spriteSrcY

        lda #20
        sta spriteWidth

        lda #26
        sta spriteHeight

        lda #150
        sta spriteDstX

        lda #89
        sta spriteDstY

        jsr drawSplashSprite


        lda #0
        sta spriteSrcX

        lda #41
        sta spriteSrcY

        lda #146
        sta spriteWidth

        lda #26
        sta spriteHeight

        lda #83
        sta spriteDstX

        lda #89
        sta spriteDstY

        jsr drawSplashSprite

        jsr splashColorTable

        rts
        
        
        
drawSplashSprites entry

; dragon skill level [3]

        lda gameDifficultyLeft
        cmp #0
        beq noviceSkill

        lda #148
        sta spriteSrcX

        bra skillDone
        
noviceSkill anop

        lda #0
        sta spriteSrcX
        
skillDone anop
        
        lda #14
        sta spriteSrcY
        
        lda #146
        sta spriteWidth
        
        lda #12
        sta spriteHeight
        
        lda #83
        sta spriteDstX

        lda #116
        sta spriteDstY

        jsr drawSplashSprite

; dragon smartness [4]

        lda gameDifficultyRight
        cmp #0
        beq smartDragons

        lda #148
        sta spriteSrcX

        bra smartDone
        
smartDragons anop

        lda #0
        sta spriteSrcX
        
smartDone anop

        lda #1
        sta spriteSrcY
        
        lda #146
        sta spriteWidth
        
        lda #12
        sta spriteHeight
        
        lda #83
        sta spriteDstX

        lda #130
        sta spriteDstY

        jsr drawSplashSprite

; control input type [j/k]

        lda enableJoystick
        cmp #0
        bne notJoystick

        lda #148
        sta spriteSrcX

        bra joyStickDone
        
notJoystick anop
        
        lda #0
        sta spriteSrcX
        
joyStickDone anop
        
        lda #27
        sta spriteSrcY
        
        lda #146
        sta spriteWidth
        
        lda #12
        sta spriteHeight
        
        lda #83
        sta spriteDstX

        lda #64
        sta spriteDstY

        jsr drawSplashSprite
        
        rts
        
        
drawSplashSprite entry

        lda #0
        sta rowCounter

fillVLoop anop

; src
        lda rowCounter
        clc
        adc spriteSrcY
        asl a
        tax
        lda spriteRowOffsets,x
        clc
        adc spriteSrcX
        sta dataCounter

; dst
        lda rowCounter
        clc
        adc spriteDstY
        asl a
        tax
        lda screenRowOffsets,x
        clc
        adc spriteDstX
        sta screenCounter

        lda spriteWidth
        sta colCounter

fillHLoop anop

        short m
        ldx dataCounter
        lda >splashSpritesList,x
        ldx screenCounter
        sta >SCREEN_ADDR,x
        long m
        
        inc dataCounter
        inc dataCounter
        inc screenCounter

        dec colCounter
        dec colCounter

        lda colCounter
        bmi nextRow
        bra fillHLoop

nextRow anop
        inc rowCounter
        lda rowCounter
        cmp spriteHeight
        beq fillDone
        bra fillVLoop

fillDone anop

        rts
        

rowCounter dc i2'0'
colCounter dc i2'0'

rowAddress dc i4'0'

screenCounter dc i4'0'
dataCounter dc i4'0'

spriteSrcX dc i2'0'
spriteSrcY dc i2'0'

spriteDstX dc i2'0'
spriteDstY dc i2'0'

spriteWidth dc i2'0'
spriteHeight dc i2'0'


